import React, { useEffect } from "react";
import "./App.scss";
import { connect } from "react-redux";
import { getCustomers } from "./action/getCustomer";

const App = ({ customerList, getCustomers }) => {
  useEffect(() => {
    getCustomers();
  }, [getCustomers]);

  return (
    <div>
      hello
      <div>{customerList.length}</div>
    </div>
  );
};

const mapStateToProps = state => ({
  customerList: state.customerList
});

export default connect(mapStateToProps, { getCustomers })(App);
